        that even a stellar cast and great acting can''t help its demise. They lost
        me somewhere in between grazing dinosaurs, a dysfunctional 1950''s family
        and an entirely mute Sean Penn riding up elevators in present-day highrises.\",\"updated_time\":\"2011-06-13T05:14:34+0000\"},{\"id\":\"171263412883960\",\"from\":{\"name\":\"Wolfram
